// Define the desired framebuffer resolution (here we set it to 720p).
#define FB_WIDTH  1280
#define FB_HEIGHT 720

inline int toPos(int x,int y,int stride){
    return y * stride / sizeof(u32) + x;
}

inline int myAbs(int x){
    return x>=0?x:-x;
}

const std::string WHITESPACE = " \n\r\t\f\v";
 
std::string ltrim(const std::string &s)
{
    size_t start = s.find_first_not_of(WHITESPACE);
    return (start == std::string::npos) ? "" : s.substr(start);
}
 
std::string rtrim(const std::string &s)
{
    size_t end = s.find_last_not_of(WHITESPACE);
    return (end == std::string::npos) ? "" : s.substr(0, end + 1);
}
 
std::string trim(const std::string &s) {
    return rtrim(ltrim(s));
}

inline int parseHex(char c){
    if(c>='0' && c<='9'){
        return c-'0';
    }
    if(c>='a' && c<='f'){
        return c-'a'+10;
    }
    if(c>='A' && c<='f'){
        return c-'A'+10;
    }
    return 0;
}

void renderPic(int x,int y,int stride,string data,int width,int height,int srcWidth,int srcHeight, u32* fb){
    int vals[srcWidth][srcHeight];
    int loc=0;
    for(int i=0;i<srcWidth;i++){
        for(int j=0;j<srcHeight;j++){
            //read a hex
            u32 val=0;
            for(int k=0;k<6;k++){
                val=val*16+parseHex(data[loc]);
                loc++;
            }

            vals[i][j]=val;
        }
    }

    for(int i=0;i<width;i++){
        for(int j=0;j<height;j++){
            if(x+i<FB_WIDTH && y+j<FB_HEIGHT){ //prevent segmentation fault
                int tox=i*srcWidth/width;
                int toy=j*srcHeight/height;
                fb[toPos(x+i,y+j,stride)]=vals[tox][toy];
            }
        }
    }
}

//render text with given size
void renderText(int x,int y,int stride,string text,int size, int margin, u32* fb,int shake=0,int maxPerLine=999999){
    int lx=x;
    int ly=y;
    int curLine=0;
    for(int i=0;i<text.length();i++){
        char c=text[i];
        if(c>='A' && c<='Z'){
            c=c-'A'+'a';
        }

        if(c=='\n'){
            ly+=size+margin;
            lx=x;
            curLine=0;
        }else{
            if(c!=' '){
                if(chars.count(c)){
                    if(shake!=0){
                        renderPic(lx+rand()%(2*shake)-shake,ly+rand()%(2*shake)-shake,stride,chars[c],size,size,5,5,fb);
                    }else{
                        renderPic(lx,ly,stride,chars[c],size,size,5,5,fb);
                    }
                }
            }

            lx+=size+margin;
            curLine++;

            if(curLine>=maxPerLine){
                ly+=size+margin;
                lx=x;
                curLine=0;
            }
        }

    }
}

