const int LOADSCR=3;
const int STARTSCR=0;
const int GACHASCR=1;
const int INFOSCR=2;

int screenId=STARTSCR;
string screenPara="";
int cursorIndex=0;

string lastGachaResult[13];

//true if gacha animation is playing
bool isGacha=false;
//current playing animation of gacha
int gachaId=0;
//animation timer for this gacha
int animationTimer=60;

string pickChar(string rarity){
    vector<string> candidate;
    for(auto x:gachas){
        if(x.second.rarity==rarity){
            candidate.push_back(x.first);
        }
    }

    if(candidate.empty()){
        return "chen";
    }else{
        return candidate[rand()%candidate.size()];
    }
}

void performGacha(){
    int rng=rand()%100;
    //2%SSR 5%SR 15%R 78%C
    if(rng<=1){
        lastGachaResult[gachaId]=pickChar("SSR");
        return;
    }
    if(rng<=6){
        lastGachaResult[gachaId]=pickChar("SR");
        return;
    }
    if(rng<=2+5+15-1){
        lastGachaResult[gachaId]=pickChar("R");
        return;
    }
    lastGachaResult[gachaId]=pickChar("C");
}

// Main program entrypoint
int main(int argc, char* argv[])
{
    // Retrieve the default window
    NWindow* win = nwindowGetDefault();

    // Create a linear double-buffered framebuffer
    Framebuffer fb;
    framebufferCreate(&fb, win, FB_WIDTH, FB_HEIGHT, PIXEL_FORMAT_RGBA_8888, 2);
    framebufferMakeLinear(&fb);

    // Configure our supported input layout: a single player with standard controller styles
    padConfigureInput(1, HidNpadStyleSet_NpadStandard);

    // Initialize the default gamepad (which reads handheld mode inputs as well as the first connected controller)
    PadState pad;
    padInitializeDefault(&pad);

    u32 cnt = 0;

    // Initialise sockets
    socketInitializeDefault();
    // redirect stdout & stderr over network to nxlink
    nxlinkStdio();
    printf("Hello,World\n");

    for(int i=0;i<10;i++){
        lastGachaResult[i]="";
    }

    srand(time(0));

    loadFont();

    loadGacha();
    //load gacha
    gachas[""]=newCB("Unknown","UK","Press Gacha to get new characters",
    "");
    

    // Main loop
    while (appletMainLoop())
    {
        
    
        // Scan the gamepad. This should be done once for each frame
        padUpdate(&pad);

        // padGetButtonsDown returns the set of buttons that have been
        // newly pressed in this frame compared to the previous one
        u64 kDown = padGetButtonsDown(&pad);

        if (kDown & HidNpadButton_Plus)
            break; // break in order to return to hbmenu

        // Retrieve the framebuffer
        u32 stride;
        u32* framebuf = (u32*) framebufferBegin(&fb, &stride);

        cnt++;

        //clear screen
        for (u32 y = 0; y < FB_HEIGHT; y ++)
        {
            for (u32 x = 0; x < FB_WIDTH; x ++)
            {
                framebuf[toPos(x,y,stride)] = 0xffffffff;
            }
        }

        if(screenId==STARTSCR){
            renderText(100,100,stride,"GACHA NX",64,5,framebuf,10);

            if(gachas.size()==0){
                renderText(100,300,stride,"ERROR Failed to load gacha database. Please make sure gacha.txt is present.",16,5,framebuf,60);
            }else{
                if(cnt%120<=60){
                    renderText(100,300,stride,"Press A to start",32,5,framebuf);
                }
                if(kDown & HidNpadButton_A){
                    screenId=GACHASCR;
                    cursorIndex=0;
                }
            }


            renderText(100,500,stride,to_string(gachas.size())+" char loaded.\nXGN from HHS Aug 2022",16,5,framebuf);

            
        }else if(screenId==GACHASCR){
            renderText(100,100,stride,"GACHA NX",64,5,framebuf,10);

            //gacha background logic
            if(isGacha){
                u32 color=0;
                string r=gachas[lastGachaResult[gachaId]].rarity;
                if(r=="SSR"){
                    color=0xFF01DFD7;
                }else if(r=="SR"){
                    color=0xFF8A084B;
                }else if(r=="R"){
                    color=0xFF00FF40;
                }else{
                    color=0xFFFFFFFF;
                }

                for (u32 y = 0; y < FB_HEIGHT; y ++){
                    for (u32 x = 0; x < FB_WIDTH; x ++){
                        framebuf[toPos(x,y,stride)] = color;
                    }
                }
            }
            for(int i=0;i<10;i++){
                renderPic(100+i%5*158,300+i/5*158,stride,gachas[lastGachaResult[i]].pic,128,128,32,32,framebuf);
            }

            //gacha animation logic
            if(isGacha){
                renderPic(100+gachaId%5*158,300+gachaId/5*158,stride,gachas[lastGachaResult[gachaId]].pic,128+animationTimer*10,128+animationTimer*10,32,32,framebuf);
                animationTimer--;
                if(animationTimer<=0){
                    gachaId++;
                    animationTimer=60;
                    if(gachaId<10){
                        performGacha();
                    }else{
                        isGacha=false;
                    }
                }
            }

            if(!isGacha && cnt%120<=60){
                renderText(100,600,stride,"Press X to gacha",16,5,framebuf);
            }

            //render cursor
            if(!isGacha){
                renderText(100+cursorIndex%5*158,300+cursorIndex/5*158,stride,"A",24,0,framebuf);
            }

            //read input and move cursor
            if(kDown & HidNpadButton_AnyDown){
                cursorIndex=(cursorIndex+5)%10;
            }
            if(kDown & HidNpadButton_AnyUp){
                cursorIndex=(cursorIndex+5)%10;
            }
            if(kDown & HidNpadButton_AnyLeft){
                cursorIndex=(cursorIndex+9)%10;
            }
            if(kDown & HidNpadButton_AnyRight){
                cursorIndex=(cursorIndex+1)%10;
            }

            if(!isGacha && (kDown & HidNpadButton_X)){
                //TODO perform gacha
                isGacha=true;
                gachaId=0;
                animationTimer=60;
                performGacha();
            }

            if(!isGacha && (kDown & HidNpadButton_A)){
                //show character info
                screenId=INFOSCR;
                screenPara=lastGachaResult[cursorIndex];
            }

            if(!isGacha && (kDown & HidNpadButton_B)){
                screenId=STARTSCR;
            }
        }else if(screenId==INFOSCR){
            renderText(100,100,stride,"GACHA NX",64,5,framebuf,10);

            auto g=gachas[screenPara];
            renderPic(100,200,stride,g.pic,256,256,32,32,framebuf);
            renderText(100,200,stride,g.rarity,32,5,framebuf);
            renderText(400,200,stride,g.name,32,5,framebuf);
            renderText(400,300,stride,g.desc,16,5,framebuf,0,40);

            if(kDown & HidNpadButton_B){
                screenId=GACHASCR;
            }
        }
        // test code
        // for(int y=0;y<FB_HEIGHT;y+=135){
        //     for(int x=0;x<FB_WIDTH;x+=135){
        //         renderPic(x,y,stride,test,128,128,32,32,framebuf);
        //     }
        // }

        // renderPic(100,100,stride,"ffffff",600,200,1,1,framebuf);
        // renderText(100,100,stride,"This is chen. She is a cute cat. \nPlease pat her.\n0123456789QWERTYUIOPASDFGHJKLZXCVBNM",30,5,framebuf);
        // renderPic(50,50,stride,test,2,2,framebuf);

        // // Each pixel is 4-bytes due to RGBA8888.
        // for (u32 y = 0; y < FB_HEIGHT; y ++)
        // {
        //     for (u32 x = 0; x < FB_WIDTH; x ++)
        //     {
        //         framebuf[toPos(x,y,stride)] = 0x01010101 * cnt * 4;//Set framebuf to different shades of grey.
        //     }
        // }

        // We're done rendering, so we end the frame here.
        framebufferEnd(&fb);
    }

    socketExit();
    framebufferClose(&fb);
    return 0;
}
